#include<iostream>
#include<cmath>

int n;

int vec[1000000]={2};

int count;

int res=1;

int main(){
    
    std::cin>>n;
    
    for(int i=3;i<=n;i++){
        
        for(int j=0;j<=count;j++){
            
            if(i%vec[j]==0)
                break;
            
            if(j==count||pow(i,0.5)<vec[j]){
                res++;
                count++;
                vec[count]=i;
                break;
            }
        }
        
    }
    
    std::cout<<res<<std::endl;
    
    return 0;
}
